- input: "TEXT\x1CC00471292\x1C.TEXT\x1C\x1CF3A\x1CSchedule A discloses contributions
    earmarked through American Solutions PAC, but does not disclose a memo entry itemizing
    American Solutions PAC as the conduit.  Please be advised that the total amount
    earmarked through American Solutions PAC does not match up to the total amount
    of contributions as disclosed by being earmarked from American Solutions PAC on
    this report.  This is because the date of the original contributions span two
    reporting periods- the Pre-General and the Post-General Reports. The Post-General
    Report discloses the rest of the contributions earmarked by American Solutions,
    as well as a memo entry itemizing the total amount transferred from American Solutions
    on October 15.\n"
